INSERT INTO kategori (ID_Kategori, Nama_Kategori, Deskripsi_Kategori) VALUES ('KAT0001', 'Dasar-Dasar Statistik', 'Buku-buku dalam kategori ini mencakup konsep dasar dan fundamental statistik yang diperlukan untuk pemula maupun sebagai referensi dasar bagi peneliti.');
INSERT INTO kategori (ID_Kategori, Nama_Kategori, Deskripsi_Kategori) VALUES ('KAT0002', 'Metode Statistik dan Aplikasi', 'Buku-buku yang membahas metode statistik yang lebih mendalam dan aplikasinya dalam berbagai bidang penelitian, termasuk statistik deskriptif, inferensial, dan multivariat.');
INSERT INTO kategori (ID_Kategori, Nama_Kategori, Deskripsi_Kategori) VALUES ('KAT0003', 'Pemrograman dan Pengembangan Perangkat Lunak', 'Buku-buku yang mencakup berbagai bahasa pemrograman, teknik pengembangan perangkat lunak, serta praktek terbaik dalam pembuatan dan pemeliharaan kode.');
INSERT INTO kategori (ID_Kategori, Nama_Kategori, Deskripsi_Kategori) VALUES ('KAT0004', 'Algoritma dan Struktur Data', 'Buku-buku yang mengajarkan algoritma dasar hingga lanjutan, serta struktur data yang efisien untuk memecahkan berbagai masalah komputasi. ');
INSERT INTO kategori (ID_Kategori, Nama_Kategori, Deskripsi_Kategori) VALUES ('KAT0005', 'Sistem Basis Data', 'Buku-buku yang berfokus pada desain, implementasi, dan manajemen basis data, serta teknologi basis data terbaru.');
INSERT INTO kategori (ID_Kategori, Nama_Kategori, Deskripsi_Kategori) VALUES ('KAT0006', 'Metodologi Penelitian', 'Buku-buku yang membahas metodologi untuk penelitian ilmiah, baik kuantitatif maupun kualitatif, termasuk analisis data dan desain penelitian.');

