-- Trigger: update_stok_kembali
DROP TRIGGER IF EXISTS update_stok_kembali;
CREATE TRIGGER IF NOT EXISTS update_stok_kembali
                       AFTER INSERT
                          ON detail_pengembalian
                    FOR EACH ROW
BEGIN
    UPDATE buku
       SET Stok = Stok + NEW.Jumlah_Kembali
     WHERE ID_Buku = NEW.ID_Buku;
END;


-- Trigger: update_stok_pinjam
DROP TRIGGER IF EXISTS update_stok_pinjam;
CREATE TRIGGER IF NOT EXISTS update_stok_pinjam
                       AFTER INSERT
                          ON detail_peminjaman
                    FOR EACH ROW
BEGIN
    UPDATE buku
       SET Stok = Stok - NEW.Jumlah_Pinjam
     WHERE ID_Buku = NEW.ID_Buku;
END;


